INSERT INTO `trash` VALUES (1,'paper', 84000, 0.9, '비닐코팅된 종이와 영수증 등은 일반쓰레기로 버려주시고 그 외의 종이류는 모아서 재활용 해주세요.'),(2,'cardboard', 96000, 10.7, '골판지 박스는 종이와 분리해 재활용 해주세요.'),(3,'metal', 1740000, 19.5, '캔은 분리 배출시 캔속에 들어있는 내용물을 깨끗이 비우고 물로 헹군 후 압축해서 분리해 재활용 해주세요.'),(4,'plastic', 522000, 5.8, '페트병 플라스틱은 분리 배출시 병에 붙은 라벨을 모두 뜯고 병뚜겅을 분리하여서 버려주세요.'),(5,'trash', 300000, 3.3, '재활용 불가능한 쓰레기는 종량제 봉투에 모아서 버려주세요.'),(6, 'glass', 1650000, 18.5, '내열유리는 종량제 봉투나 특수규격마대를 이용해서 버려주시고 일반 유리는 내용물을 깨끗이 비우고 물로 헹군 후 분리해 재활용 해주세요.'),(7,'null', 480000, 5.3, 'AI가 인식하지 못한 쓰레기 입니다. 추후 이미지를 추가하겠습니다.');
